import React, {useState} from 'react';

const Header = () => {

    const [state, setState] = useState(0);

    function plus(){
        setState(state + 1);
    }
    function minus(){
        setState(state - 1)
    }
    function zero(){
        setState(0)
    }

    return (
        <div>
            <p>{state}</p>
            <button onClick={() => zero()} >zero</button>
            <button onClick={()=> plus()}>plus</button>
            <button onClick={()=> minus()}>minus</button>
        </div>
    );
}

export default Header;
